let list = trigger.args.request.query['list'];
let deleteops = trigger.args.request.query['deleteops'];
let syncGift = trigger.args.request.query['syncGift'];

if(list=== undefined) {
  list = "";
}
if(deleteops=== undefined) {
  deleteops =  "";
}

if(syncGift === undefined) {
  syncGift = "";
}
let params = {
  flag: true,
  error :{
    statusCode: 200,
    result: {
      "status":"error"
    }
  },
  input : {
    list : list,
    deleteops: deleteops,
    syncGift:syncGift,
    modelbox_check1:trigger.args.request.query.modelbox_check1,
    modelbox_check2:trigger.args.request.query.modelbox_check2

  }
};
if(list === "") {
  params.flag = false;
  params.error.result.list = "invalid Choice";
}
if(deleteops === "") {
  params.flag = false;
   params.error.result.deleteops = "invalid Choice";

}

done(params);
